// JavaScript Document
import React from 'react';
import { makeStyles } from '@material-ui/core/styles';
import ParkGridHome from '../components/grids/parkGridHome';
import Map from '../pages/map'

//images
//import logo2 from '../../images/ptBtn3.png';

//Material UI
import Grid from "@material-ui/core/Grid";
import Link from '@material-ui/core/Link';

//styles
const useStyles = makeStyles(theme => ({
  root:{				
		height:'auto',
		flexGrow: 1,
		overflow:'hidden',
		textAlign:'left',
	  marginBottom:'-3%',
	},
	a:{
		color:'grey',
		textDecoration:'none',
	},
	typography:{
		color:theme.palette.secondary.main,
	}
}));

linkHandler = (event) => {
	 console.log(event.target);
	 console.log(event.target.dataset.name);
	 // var targetId = event.target.dataset.name;
	 // window.location.assign(`http://localhost:3000/stateActivities/${targetId}`);
  };


class Index extends React.Component {

 linkHandler = (event) => {
	 console.log(event.target);
	 console.log(event.target.dataset.name);
	 // var targetId = event.target.dataset.name;
	 // window.location.assign(`http://localhost:3000/stateActivities/${targetId}`);
  };
  render() {
	  const classes = useStyles();
    return(
    <div className={classes.root}>
      <Grid container >
	  		<Grid item xs={12} md={4}>
        		<ParkGridHome />
       		</Grid>

	  		<Grid item xs={12} md={8} style={styles.rightContainer}>
	  			<Grid container>
	  				<Grid item xs={12} style={styles.map}>
	  					<Map />
	  				</Grid>
      				<Grid item xs={12}  style={styles.box}>
	  					<a className={classes.a} id={'AL'} href='https://reactjs.org'>Alabama</a><br />
            		</Grid> 
        		</Grid>
	  		</Grid>

      	</Grid>
		{this.state.index}
    </div>
  	);
  }
}

export default Index;
const styles ={
	rightContainer:{
		padding:'5%',
		marginTop:'-5%',
	},
	box:{
		columns:'4',
		padding:'4%',
	},
	map:{
		textAlign:'center',
	},
}
